import React from 'react';
import  {Link } from 'react-router-dom';

function Noticeboard() {

    return (
        <div className="description_title">
            <div className="noticeboard_title">
                <h2>CRUD 게시판</h2>
                <p className="noticeboard_title_p">2021.2 ~ 2021.3</p>
                <Link className="noticeboard_link">게시판 웹사이트로 이동</Link>
            </div>
            <div className="noticeboard_text">
                <p className="noticeboard_title_p2">CRUD 게시판 사이트는 회원가입, 로그인, 글 작성, 글 삭제, 글 수정을 할 수 있는 커뮤니티 게시판입니다. 1인 프로젝트로 React 실력 향상과 RestAPI 학습을 목적으로 만들었습니다.</p>
            </div>
            <div className="noticeboard_skils">
                <h4 className="noticeboard_title_p2">사용 기술 - React, Javascript, Node.js, Mysql</h4>
            </div>
            <div className="divider">
            </div>
            <div className="noticeboard_skils">
                <p className="noticeboard_title_p2">저는 이런 일에 기여했습니다.</p>
            </div>

        </div>
    );
  
  }


export default Noticeboard;
